import React, { useEffect, useState } from "react";
import axios from "axios";
import Cards from "./Cards";

const MovieTendance = () => {
  const [movieTendnace, setMovieTendance] = useState([]);

  useEffect(() => {
    axios
      .get(
        "https://api.themoviedb.org/3/discover/movie?api_key=864b6602f4018630491e67fa714381e6&query=a&page=1&language=fr-FR"
      )
      .then((res) => setMovieTendance(res.data.results));
  }, []);
  return (
    <div className="movie-tendance-container">
      <h1>Movie tendance</h1>
      <Cards />
    </div>
  );
};

export default MovieTendance;
